import axios from 'axios'

const USER_API_URL = 'http://localhost:8080'
const INSTRUCTOR_API_URL = `${USER_API_URL}`

class UserDataService {

    retrieveAllUsers() {
        return axios.get(`${INSTRUCTOR_API_URL}/users`);
    }
}

export default new UserDataService()
